function Iphone11() {

    const [iphone,setIphone] = useState()

    const getAllIphone = async ()=>{
        const url = "http://localhost:5000/iphone/iphone11"
        const res = await fetch(url)
        const resJson = await res.json()


        setIphone(resJson)
    }


    useEffect(()=>{
      getAllIphone()
      setIphone(getAllIphone)
    },[])


  return (
    <div>


    </div>
  )
}

export default Iphone11
